import React from 'react';


const imagesArray = ["stewie.jpg"];

class Card extends React.Component() {
    render() {
        const rand = Math.random(imagesArray) >= 0.5;
        return (
            <img 
            src = {rand.imagesArray}
            alt = 'alt' />
        );
    }
}



export default Card;
